import './App.css';
import Home from './pages/Home';
import {BrowserRouter, Route,Routes} from "react-router-dom"

function App() {
  return (
  <BrowserRouter>
 <Routes>
 <Route exact path="/home" component={Home}></Route>
</Routes>
 </BrowserRouter>
  );
}

export default App;
